import React, { Component } from 'react'
import '../styles/About.scss'

class About extends Component {

    constructor(props){
        super(props);
        this.state = {
            message: "I recently graduated from the University of California, " +
                     "Merced with a B.S. in Computer Science and Engineering.",
            img: require('../Media/images/gradImg.jpg')
        }
    }

    render(){
        return(
            <div id ='aboutContainer'>
                <p id = 'aboutHeader'>About</p>
                <img id = 'gradImg' src= {this.state.img} alt = {'grad hat'}/>
                <p id ='graduation'>I recently graduated from the University of California, 
                    Merced with a B.S. in Computer Science and Engineering. 
                </p>
            </div>
        );
    }
}
export default About
